<!-- 価格背景 -->
<style type="text/css">
table#rakutenLimitedId_cart {
    background-color: #FFF0F1;
    border: 1px solid #FFF;
    padding: 5px;
    margin: 15px 0;
}
</style>
<!-- 価格背景 -->


<!-- 項目選択肢 -->
<style type="text/css">
#rakutenLimitedId_aroundCart span.choice {
    font-size: 12px;
    display: block;
    background: url( https://image.rakuten.co.jp/selection/cabinet/sentaku412.gif) no-repeat 0 0;
    color: #FFF;
    padding: 0px 0px 3px 10px;
    font-weight: bold;
    margin: 10px 0px 0px 0px;
    width: 310px;
    line-height: 31px;
}

#rakutenLimitedId_aroundCart select {
    font-size: 12px !important;
    color: #333;
    font-weight: bold;
    width: 320px;
    padding: 5px;
    margin: 0 0 5px 0px;
}
</style>
<!-- 項目選択肢 -->

